import React from "react";
import PropTypes from "prop-types";
import { useSelector } from "react-redux";

import AppLayout from "../componenets/AppLayout";

const Home = () => {
  const { login } = useSelector((state) => state.user);
  console.log(login);

  return (
    <AppLayout>
      <div>Hello, Home</div>
      <Button></Button>
    </AppLayout>
  );
};

Home.propTypes = {};

export default Home;
